        d2 = (a[0] - b[0]) ** 2 + (a[1] - b[1]) ** 2
        r1r22 = (a[2] + b[2]) ** 2
        dr1r22 = (a[2] - b[2]) ** 2
        return dr1r22 < d2 < r1r22

    def lies(a, b, c):
        d2 = (a[0] - b[0]) ** 2 + (a[1] - b[1]) ** 2
        return max(0, b[2] - a[2]) ** 2 < d2 <= max(0, c[2] - a[2]) ** 2
    a = [(ring1[0], ring1[1], ring1[2]), (ring1[0], ring1[1], ring1[3]), (ring2[0], ring2[1], ring2[2]), (ring2[0], ring2[1], ring2[3])]
    ans = 1
    for i in range(4):
        f = 0
        for j in range(4):
            if i != j and intersect(a[i], a[j]):
                f = 1
        if i < 2:
            if lies(a[i], a[2], a[3]):
                f = 1
        elif lies(a[i], a[0], a[1]):
            f = 1
        if f == 0:
            ans += 1
